import React from 'react';
import classes from "./Navbar.module.css";

const Navbar = () => {
    return (
        <nav className={classes.nav}>
        <div className={classes.item}>
          Profile
        </div>
        <div className={classes.item}>
          Profile
        </div>
        <div className={classes.item}>
          <a href="https://www.google.com/search?q=avatar&oq=avatar&aqs=chrome..69i57.4288j0j7&sourceid=chrome&ie=UTF-8">News</a>
        </div>
        <div className={classes.item}>
          <a href="/">Music</a>
        </div>
        <div className={classes.item}>
          Settings  
        </div>
      </nav>
    );
}

export default Navbar;
